import React, { useEffect, useState } from 'react';
import { useParams, useNavigate } from 'react-router-dom';
import axios from 'axios';
import './NormalizedTableView.css';

const NormalizedTableView = () => {
  const { tableName } = useParams();
  const navigate = useNavigate();
  const [tableData, setTableData] = useState({ columns: [], rows: [] });
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState('');

  useEffect(() => {
    const fetchTableData = async () => {
      try {
        const response = await axios.get(`/api/table_html/${tableName}`);
        setTableData({
          columns: response.data.columns || [],
          rows: response.data.rows || []
        });
      } catch (err) {
        setError('Failed to load table data');
      } finally {
        setLoading(false);
      }
    };

    fetchTableData();
  }, [tableName]);

  if (loading) return <div className="loading">Loading table...</div>;
  if (error) return <div className="error">{error}</div>;

  return (
    <div className="table-view-container">
      <div className="table-header">
        <h2>Table: {tableName}</h2>
        <button onClick={() => navigate('/')} className="back-button">
          ‚Üê Back to Workflow
        </button>
      </div>
      
      <div className="table-wrapper">
        <table className="normalized-table">
          <thead>
            <tr>
              {tableData.columns.map((col) => (
                <th key={col}>{col}</th>
              ))}
            </tr>
          </thead>
          <tbody>
            {tableData.rows.map((row, rowIndex) => (
              <tr key={rowIndex}>
                {row.map((cell, cellIndex) => (
                  <td key={cellIndex}>{cell}</td>
                ))}
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>
  );
};

export default NormalizedTableView;
